import { Avatar } from '@material-ui/core';
import React from 'react'
import './Post.css'

function Post(profilePic, image, usename, timestamp, message) {
    return (
        <div className='post'>
        <h2>All your posts would be there</h2>
        <Avatar src={profilePic} className='avatar__post'/>
        </div>
    )
}

export default Post;
